        #region DeepCopyIn
        public void DeepCopyIn(
            ILocationInternal item,
            ILocationGetter rhs,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask,
            bool deepCopy)
        {
            base.DeepCopyIn(
                item,
